syntax = "proto3";
package FloatingCardInfo;
import "ProtobufUrlStructV2Adapter.proto";
message ProtobufAwemeFloatingCardStructV2Adapter{
    string schema = 1;
    string schema_desc = 2;
    repeated UrlModel.ProtobufUrlStructV2Adapter icons = 3; 
    string title = 4;
    string description = 5;
    string button_desc = 6;
    UrlModel.ProtobufUrlStructV2Adapter button_bg = 7; 
}